let problem = null;

const testSafe = (i, j, d, index, secondRun) => {
  if(i === j) {
    problem = index;
    return false;
  }

  if(Math.abs(i - j) > 3) {
    problem = index;
    return false;
  }

  if(i > j && d !== 1 || i < j && d !== 2) {
    problem = index;
    return false;
  }
  return true;
}

const calculateDirection = (list) => {
  const directions = {"1": 0, "2": 0};
  list.forEach((item, k) => {
    if(list[k] && list[k+1]) {
      directions[list[k] > list[k+1] ? "1" : "2"]++;
    }
  });
  if(directions['1'] >= directions['2']) {
    return 1;
  }
  return 2;
}

const processRow = (row, secondRun) => {
  let isSafe = true;
  let index = 0;
  let direction = calculateDirection(row);
  let item = row.shift();
  do {
    const compare = row.shift();
    isSafe = testSafe(item, compare, direction, index, secondRun);
    index++;
    item = compare;
  } while (item && isSafe && row.length);
  return isSafe;
}

let safeCount = 0;
input.forEach((row, k) => {
  problem = null;
  const rowCopy = [...row];
  let isSafe = processRow(row);
  if(isSafe) {
    safeCount++;
  }else {
    let isSafeSecond;
    for(let i = 0; i <rowCopy.length; i++) {
      const toProcess = [...rowCopy];
      delete toProcess[i];
      isSafeSecond = processRow(toProcess.filter(s=> s), 1);
      if(isSafeSecond) {
        safeCount++;
        break;
      }
    }
  }
});

